import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import Card from "../components/Card";
import Carousal from "../components/Carousal";
import "./Pages.css";
const Home = () => {
  return (
    <div>
      <div>
        <Navbar />
      </div>
      <div className="banner">
        <Carousal />
      </div>
      <div>
        <Card />
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
};

export default Home;
